import React from 'react'
import styled from 'styled-components';
import { MessageSender } from './MessageSender';
import Post from './Post';

const FeedContainer = styled.div`
  display:flex;
  padding:30px 150px;
  flex:1;
  flex-direction:column;
  justify-content:center;
  align-items:center;
`



const Feed = () => {
  return (
    <FeedContainer>
      <MessageSender />
      <Post/>
    </FeedContainer>
  )
}

export default Feed
